    const [val, setVal] = useState(0)
    return (
        <div>
            <div id="input-box">
            <label id = "zipCodeButton">ZipCode: </label>
            <input type={"text"} onInput={event => setVal(event.target.value)}/>
            </div>
            <SearchResults zip={val}/>
        </div>
    )
}
